import logo from "./logo.svg";
import "./App.css";
import io from "socket.io-client";

const handleClick = () => {
  const socket = io("http://localhost:3000");
  console.log(socket.id);
};

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <button onClick={handleClick}>connect</button>
      </header>
    </div>
  );
}

export default App;
